import Navbar from "./Navbar";
import { useState, useEffect } from "react";

function Main(){

    const [questions, setQuestions] =  useState([])

    useEffect(()=>{
        fetch('http://127.0.0.1:8000/quizapp/get_questions/')
        .then(res=>res.json())
        .then(data=>{
            if(data.ok){
                setQuestions(data)
                console.log(data)
            }
        })
    },[])

    return(
        <div>
            <Navbar />
            <div>

            </div>
        </div>
    )
}
export default Main;
